import React, { useState } from "react";
import classNames from "classnames";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import { faBars } from "@fortawesome/free-solid-svg-icons";

import { Img, Text, Button } from "components";
import { useNavigate } from "react-router-dom";

const LandingPageNavbar = (props) => {
  const navigate = useNavigate();
  const [isMobileMenuOpen, setIsMobileMenuOpen] = useState(false);

  const handleMobileMenu = () => {
    setIsMobileMenuOpen(!isMobileMenuOpen);
  };

  return (
    <>
      <div
        className={props.className}
        style={{
          position: "fixed",
          top: 25,
          left: 0,
          right: 0,
          display: "flex",
          justifyContent: "space-between",
          alignItems: "center",
          backgroundColor: "rgba(255, 255, 255, 0.96)",
        }}
      >
        <div
          className="common-pointer flex flex-row gap-[5px] items-center justify-start pr-1.5 w-1/4 md:w-full ml-10"
          onClick={() => navigate("/")}
          style={{ marginLeft: "5px" }}
        >
          <Img
            src="images/img_image1.png"
            className="h-9 md:h-auto object-cover w-[37px]"
            alt="imageOne"
          />
          <Text
            className="font-helveticaneue text-black_900 text-center w-auto"
            as="h6"
            variant="h6"
          >
            {props?.waffle}
          </Text>
        </div>
        <div className="hidden md:flex">
          <div className="flex flex-col items-center justify-start w-auto md:w-full">
            <Text
              className="common-pointer font-helveticaneue font-normal text-black_900 text-left w-auto"
              variant="body3"
              onClick={() => navigate("/#product")}
            >
              {props?.product}
            </Text>
          </div>
          <div className="flex flex-col items-center justify-start w-auto md:w-full">
            <Text
              className="common-pointer font-helveticaneue font-normal text-black_900 text-left w-auto"
              variant="body3"
              onClick={() => navigate("/newsfeed")}
            >
              {props?.readnews}
            </Text>
          </div>
          <Button
            className="common-pointer cursor-pointer font-helveticaneue font-medium min-w-[133px] text-base text-black_900 text-center w-auto mr-10"
            onClick={() => navigate("/waitlist")}
            shape="RoundedBorder10"
            size="md"
            variant="FillOrangeA100"
            style={{ marginRight: "5px" }}
          >
            {props?.joinWaitlist}
          </Button>
        </div>
        <div className="md:hidden">
          <FontAwesomeIcon
            icon={faBars}
            className="common-pointer text-3xl"
            onClick={handleMobileMenu}
          />
        </div>
      </div>
      {isMobileMenuOpen && (
        <div
        className="fixed top-0 left-0 w-full h-full bg-white z-10 flex flex-col items-center justify-start md:hidden"
        style={{
          paddingTop: "100px",
          backgroundColor: "rgba(255, 255, 255, 0.98)",
        }}
      >
        <div className="flex flex-col items-center justify-start w-auto">
          <Text
            className="common-pointer font-helveticaneue font-normal text-black_900 text-left w-auto mb-4"
            variant="body3"
            onClick={() => {
              setIsMobileMenuOpen(false);
              navigate("/#product");
            }}
          >
            {props?.product}
          </Text>
        </div>
        <div className="flex flex-col items-center justify-start w-auto">
          <Text
            className="common-pointer font-helveticaneue font-normal text-black_900 text-left w-auto mb-4"
            variant="body3"
            onClick={() => {
              setIsMobileMenuOpen(false);
              navigate("/newsfeed");
            }}
          >
            {props?.readnews}
          </Text>
        </div>
        <Button
          className="common-pointer cursor-pointer font-helveticaneue font-medium min-w-[133px] text-base text-black_900 text-center w-auto mb-4"
          onClick={() => {
            setIsMobileMenuOpen(false);
            navigate("/waitlist");
          }}
          shape="RoundedBorder10"
          size="md"
          variant="FillOrangeA100"
        >
          {props?.joinWaitlist}
        </Button>
      </div>
    )}
  </>
);
};

LandingPageNavbar.defaultProps = {
waffle: "Waffle.",
product: "Product",
readnews: "Read News",
joinWaitlist: "Join waitlist",
};

export default LandingPageNavbar;
